  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Lake Ilo
  NWR and the District IV easement refuges outlines Refuge accomplishments during
  the 1971 calendar year. The report begins by summarizing the weather conditions,
  habitat conditions, water conditions, and food and cover conditions during the year.
  Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
  predators, rodents, mammals, raptors, fish, and diseases- is also covered. The Refuge
  development and maintenance section discusses physical developments, plantings,
  collections and receipts, and vegetation control. Resource management is outlined;
  topics include grazing, haying, and fur harvesting. The public relations section
  of the report describes recreational uses, Refuge visitors, and Refuge participation.
  Items of interest, N-R forms, and photographs are attached.\",\n\t\"owner_org\":
